import { View, Text, StyleSheet, Image,TouchableOpacity } from 'react-native'
import React, {useState, useEffect} from 'react'
import { useNavigation } from '@react-navigation/native'

const RoommateViewPostScreen = () => {

// page navagation
const navigation = useNavigation();

  return (

    
    <View style={styles.container}>
      <Text style={styles.findRoommateTitle}>Find Roommate</Text>
      <View style={styles.roommateProfileContainer}>
        <Image style={styles.profileImage} source={require('../assets/room.jpg')}></Image>

      </View>
    </View>
  )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        display: "flex",
        paddingVertical: "30px",
        alignItems: 'center'
      },
    
    findRoommateTitle: {
        fontSize: '24px',
        fontWeight: 'bold',
        textAlign: 'center',
        paddingBottom: '30px'
    },

    roommateProfileContainer: {
        width: '110%',
        height: '35%',
        backgroundColor: '#FFEDDD',
        padding: '30px',
        borderColor: '#401F02',
        borderWidth: '3px'
      },

    profileImage: {
        width: 100,
        height: 100,
        borderRadius: 100 / 2,
        marginLeft: '30px',
        borderRadius: '30px',
    }
})


export default RoommateViewPostScreen
